import React from 'react'
function Login() {
  return (
    <div className='bg-green-100 shadow-sm h-[30%] w-1/2 items-center'>
        <div className='items-center'>
            
            <input className='items-center'>Enter your email</input>
        </div>
    </div>
  )
}

export default Login
